#include <iostream>
#include <fstream>

void inverse(int* a, int* b, int n) {
    for (size_t i = 0; i < n; ++i)
        b[a[i] - 1] = i + 1;
    for (size_t i = 0; i < n; i++)
        std::cout << b[i] << " ";
}


int main() {
    std::ifstream file("input.txt");
    int n;
    file >> n;
    int a[n], b[n];

    for (size_t i = 0; i < n; i++)
        file >> a[i];
    
    inverse(a, b, n);
}